import React, { useState } from 'react'
import { TableContainer,TableBody,TableHead,Table,TableRow,TableCell,TextField,Button,Paper } from '@material-ui/core'
const TAble = () => {
    const[subData,setSubData]=useState([])
    const[finalData,setFinalData]=useState([])
    function submitData(subData){
        
            setFinalData(finalData=>[...finalData,subData])
            setSubData(subData={})
            document.myForm.reset;
        }
    
  return (
    <div>
        <form name='myForm'>
        
    <TableContainer component={Paper}>
    <Table sx={{ minWidth: 650 }} aria-label="simple table">
      <TableHead>
        <TableRow>
          <TableCell><TextField  value={subData['sub']} onChange={(e)=>setSubData({...subData,'sub':e.target.value})} label="name"/> </TableCell>
          <TableCell><TextField  value={subData['sub']} onChange={(e)=>setSubData({...subData,'sub':e.target.value})} label="name"/></TableCell>
          <TableCell><Button onClick={()=>submitData(subData)}>add</Button></TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {finalData.map((row,i) => (
          <TableRow
            key={i}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
          >
            <TableCell align="right">{row.sub}</TableCell>
            <TableCell align="right">{row.sem}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
  </TableContainer>
  </form>
  </div>
  )
}

export default TAble
